                "name": "Item",
                "template": "<!-- HELP  ITEM v1.0-->\n<!-- Use with detail rows pivoted for vertical presentation)-->\n\n<!-- OPTIONS -->\n\n<!-- SUPPORTED -->\n<!-- only single level groupings; no second leve groupings rendered -->\n\n<!-- END OF HELP -->\n\n<style>\n.data-table .item-label {\n    line-height: 1.1;\n    vertical-align: bottom;\n    padding: 4px 6px 4px 1px !important;\n    border-left: 1px solid #efefef !important;\n     text-align:right;width:25% !important\n}\n.data-table .item-data {\n    line-height: 1.1;\n    vertical-align: bottom;\n    padding: 4px 6px 4px 1px !important;\n    border-left: 1px solid #efefef !important;\n    text-align:left;font-weight:bold\n}\n\n</style>\n\n\n<!-- DEFAULT SETTING FROM VIEW ADVANCED SETTINGS -->\n{% assign options = Option | split : \";\" %}\n{% assign rowtotals  = true %}\n\n<!-- BIND USER SPECIFIED OPTION OVERRIDES -->\n    {% for option in options %}\n      {% assign thisOptions = option | split : \"=\" %}\n            {% case thisOptions[0] %}\n                 {% when 'rowtables' %}\n                     {% if thisOptions[1] == \"true\" %}\n                         {% assign coltotals = true %}\n                    {% else %}\n                        {% assign coltotals = false %}\n                   {% endif %}\n           {% endcase %}\n    {% endfor %}\n\n<!-- OUTPUT PIVOT TABLE VIEW -->\n{% assign tableName= 'myTable' %}\n<div class=\"data-table-wrapper\">\n   <table id=\"{{-tableName-}}\" class=\"data-table {{ activeclass }}\">\n\n   <!-- OUTPUT COLUMN HEADER -->\n     <tbody>\n\n\n        {% for col in Rows[0] %}\n        {%if col[0] contains \"UID\"%}{%else%}\n            <tr>\n               <td class=\"item-label\">{{col[0]}}</td>\n               <td class=\"item-data\">{{col[1]}}</td>\n             </tr> \n        {%endif%}\n        {% endfor%}\n\n \n     </tbody>\n    </table>\n</div>\n",
