                "id": "996dba7e-e0e6-ea11-8b03-0003ffff5899",
                "name": "(Server) Investment Performance Monthly",
                "template": "<style>\n    .liq-data-table th {\n        line-height: 1.1;\n        vertical-align: bottom;\n        padding: 4px !important;\n        border-left: 1px solid #efefef !important\n    }\n    .liq-align-left {\n        text-align: left !important;\n    }\n    .liq-align-right {\n        text-align: right !important;\n    }\n  \n  </style>\n  {%- assign tableName= 'myTable' -%}\n  <!-- liquid-top view process all cols (Label, Value) adding % of Total -->\n  <div class=\"data-table-wrapper\">\n    <table\n        id=\"{{ tableName }}\" class=\"liq-data-table {{ activeclass }}\">\n        <!-- building from column names-->\n        <thead>\n            <tr>\n                <th class=\"liq-align-left\" style=\"width:20%\">Date\n                </th>\n                <th class=\"liq-align-right\">Beginning Market Value\n                </th>\n                <th class=\"liq-align-right\">Net Flows\n                </th>\n                <th class=\"liq-align-right\">Expenses/Income\n                </th>\n                <th class=\"liq-align-right\">Gain/Loss\n                </th>\n                <th class=\"liq-align-right\">Market Value\n                </th>\n                <th class=\"liq-align-right\">Month to Date\n                </th>\n                <th class=\"liq-align-right\">Quarter to Date\n                </th>                \n                <th class=\"liq-align-right\">Year to Date\n                </th>\n                <th class=\"liq-align-right\">Inception to Date\n                </th>\n            </tr>\n        </thead>\n        <tbody>\n            {% for row in Rows %}\n                <tr>\n                    {%- for col in row.Columns -%}\n                        {% if col.Key == \"Date\" %}\n                            {% assign Date = col.Value %}\n                        {% endif %}\n                        {% if col.Key == \"StartMTDValue\" %}\n                            {% assign StartValue= col.Value|u_toint %}\n                        {% endif %}\n                        {% if col.Key == \"Contributions\" %}\n                            {% assign contributions= col.Value|Round%}\n                        {% endif %}\n                        {% if col.Key == \"Withdrawals\" %}\n                            {% assign withdrawals = col.Value|Round%}\n                        {% endif %}\n                        {% if col.Key == \"Sales\" %}\n                            {% assign Sales= col.Value|u_toint %}\n                        {% endif %}\n                        {% if col.Key == \"Purchases\" %}\n                            {% assign Purchases= col.Value|u_toint %}\n                        {% endif %}\n                        {% if col.Key == \"Income\" %}\n                            {% assign Income= col.Value|Round %}\n                        {% endif %}\n                        {% if col.Key == \"Expenses\" %}\n                            {% assign Expenses= col.Value|Round %}\n                        {% endif %}\n                        {% if col.Key == \"ManagementFee\" %}\n                            {% assign ManagementFee= col.Value|Round %}\n                        {% endif %}\n                        {% if col.Key == \"Other\" %}\n                            {% assign OtherFee= col.Value|Round %}\n                        {% endif %}\n                        {% if col.Key == \"MarketValue\" %}\n                            {% assign EndValue = col.Value|u_toint %}\n                        {% endif %}\n                        {% if col.Key == \"MTD\" %}\n                            {% assign MTD = col.Value%}\n                        {% endif %}\n                        {% if col.Key == \"QTD\" %}\n                            {% assign QTD = col.Value%}\n                        {% endif %}                        \n                        {% if col.Key == \"YTD\" %}\n                            {% assign YTD = col.Value%}\n                        {% endif %}\n                        {% if col.Key == \"ITD\" %}\n                            {% assign ITD = col.Value%}\n                        {% endif %}\n                    {% endfor %}\n  \n                    {% assign netflows = contributions|Plus:withdrawals %}\n  \n                    {% assign netincome = Income|Plus:Expenses|Plus:ManagementFee|Plus:OtherFee%}\n                    {% assign gainloss = EndValue|Minus:netincome|Minus:netflows|Minus:StartValue %}\n          \n          {% assign startvalue_format = StartValue|uformat_number %}\n          {% assign netflows_format = netflows||uformat_double_dynamic:0 %}\n          {% assign netincome_format = netincome|uformat_double_dynamic:0 %}\n          {% assign gainloss_format = gainloss|uformat_double_dynamic:0 %}\n          {% assign endvalue_format = EndValue|uformat_number %}\n  \n                    <td class=\"liq-align-left\">{{ Date }}</td>\n                    <td class=\"liq-align-right\">{{ startvalue_format | uformat_string_replace: \"0,0.00\": \"-\" }}</td>\n                    <td class=\"liq-align-right\">{{ netflows_format | uformat_string_replace: \"0,0.00\": \"-\" }}</td>\n                    <td class=\"liq-align-right\">{{ netincome_format | uformat_string_replace: \"0,0.00\": \"-\" }}</td>\n                    <td class=\"liq-align-right\">{{ gainloss_format | uformat_string_replace: \"0,0.00\": \"-\" }}</td>\n                    <td class=\"liq-align-right\">{{ endvalue_format | uformat_string_replace: \"0,0.00\": \"-\" }}</td>\n                    <td class=\"liq-align-right\">{{ MTD | concat : '%' | uformat_string_replace: \"0,0.00\": \"-\" }}{% if MTD != \"0\" and  MTD != \"0.00\" %}%{% endif %}</td>\n                    <td class=\"liq-align-right\">{{ QTD | concat : '%' | uformat_string_replace: \"0,0.00\": \"-\" }}{% if QTD != \"0\" and  QTD != \"0.00\" %}%{% endif %}</td>\n                    <td class=\"liq-align-right\">{{ YTD | concat : '%' | uformat_string_replace: \"0,0.00\": \"-\" }}{% if YTD != \"0\" and  YTD != \"0.00\" %}%{% endif %}</td>\n                    <td class=\"liq-align-right\">{{ ITD | concat : '%' | uformat_string_replace: \"0,0.00\": \"-\" }}{% if ITD != \"0\" and  ITD != \"0.00\" %}%{% endif %}</td>\n                </tr>\n            {% endfor %}\n        </tbody>\n        <tfoot></tfoot>\n    </table>\n  </div>",
