                "template": "<!-- HELP EXTRACT v1.2 (Server Side) -->\n\n<!-- enabled/disable sample custom fields -->\n{%assign custom = false%}\n\n<div class=\"data-table-wrapper\">\n  <table >\n\n    <!-- building from column names from Schema-->\n    <thead>\n      <tr>\n         {% for schema in Schema %}\n            {% if schema.Visibility == 'v'%}\n                    <th>{{schema.Caption| Replace: ' ', '_'}}</th>\n             {% endif %}\n         {% endfor %}\n\n         <!-- add additional custom columns -->\n         {% if custom %}\n           <th>Custom1</th>\n           <th>Custom2</th>\n         {% endif %}\n\n       </tr>\n    </thead>\n\n    <!-- enumerate rows and columns-->\n    <tbody>\n\n    {% for row in Rows%}\n       <tr>\n      {% for col in row.Columns%}\n\n                  {% assign colname = col.Key%}\n                  {% assign colvalue = col.Value%}\n                  {% for schema in Schema %}\n                      {% if schema.ColumnName == colname %}\n\n                        <!--collect variables for custom fields-->\n                          {%case colname%}\n                            {%when 'Account_Status'%}{%assign account_status=col.Value%}\n                            {%when 'Pub_Update'%}{%assign pub_update=col.Value%}\n                          {%endcase%}\n\n                          {%if schema.Visibility == \"v\"%}\n                           <td>\n                           {%case colname%} \n                            {%when 'Position_Date'%}{date-to}\n                            {% else %}                \n                               {% assign schema_datatype = schema.DataType %}\n                               {% assign schema_format = schema.NumberFormat %}\n                               {% case schema_datatype%}\n                                   {% when 'string'%}\n                                          {{col.Value}}\n                                   {% when 'SQLdate'%}\n                                          {{col.Value}}\n                                   {% else %}\n                                         {{col.Value | u_toint | uformat_number | uformat_string_replace: \"0,0.00\": \"-\"}}\n                                {% endcase%}\n                           {%endcase%}\n                          </td>\n  \n\n                             {% break %}\n                         {% endif %}\n                      {% endif %}\n                  {% endfor %}\n       {%endfor%}\n\n     <!-- insert custom fields - samples below -->\n         {% if custom %}\n          <td>{{pub_update|Slice:0,4}}</td>\n          <td>\n              {%case account_status%}\n                 {%when 'ACTIVE'%}A\n                 {%else%}D\n              {%endcase%}\n         </td>\n       {% endif %}\n\n\n       </tr>\n   {% endfor %}\n  \n </tbody>\n\n     \n  </table>\n</div>",
