                "template": "<style>\n    .data-table th {\n        line-height: 1.1;\n        vertical-align: bottom;\n        padding: 4px !important;\n        border-left: 1px solid #efefef !important\n    }\n    .level1 td {\n        background: #f4f4f4 !important;\n        font-weight: bold;\n        padding-left: 4px !important\n    }\n    .level2 td:first-child {\n        padding-left: 20px !important\n    }\n    .disclaimer {\n        white-space: normal !important;\n        font-weight: normal !important;\n        font-style: italic !important;\n        text-align: left !important;\n        color: gray !important;\n        padding-top: 10px !important;\n        padding-bottom: 10px !important;\n    }\n</style>\n<!-- Category  Market Value  Period Performance Year to Date-->\n<!-- liquid-top view process all cols (Label, Value) adding % of Total -->\n<div class=\"data-table-wrapper\">\n    <table\n        id=\"myTable\" class=\"data-table\">\n        <!-- building from column names-->\n        <thead>\n            <tr>\n                <th style=\"width:40%\" class=\"text-left\">Category</th>\n                <th class=\"text-right\">Market Value</th>\n                <th class=\"text-right\">MTD</th>\n                <th class=\"text-right\">QTD</th>\n                <th class=\"text-right\">YTD</th>\n                <th class=\"text-right\">ITD</th>\n            </tr>\n        </thead>\n        <tbody>\n            {% for row in Rows %}\n                {% if row.Aggregation == 'Entity' %}\n                    <tr class=\"level1\">\n                        <td class=\"left\">Total Portfolio Returns</td>\n                        <td class=\"right\">{{- row.MarketValue|uformat_number-}}</td>\n                        <td class=\"right\">{{- row.MTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.QTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.YTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.ITD|uformat_percent_100:1-}}</td>\n                    </tr>\n                {% endif %}\n            {% endfor %}\n            {% for row in Rows %}\n                {% if row.Aggregation == 'AssetClass' %}\n                    <tr class=\"level1\">\n                        <td class=\"left\">{{ row.AggregationKey1}}</td>\n                        <td class=\"right\">{{- row.MarketValue|uformat_number-}}</td>\n                        <td class=\"right\">{{- row.MTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.QTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.YTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.ITD|uformat_percent_100:1-}}</td>\n                    </tr>\n                {% endif %}\n            {% endfor %}\n            {% for row in Rows %}\n                {% if row.Aggregation == 'AssetClass2' %}\n                    <tr class=\"level2\">\n                        <td class=\"left\">{{ row.Name }}</td>\n                        <td class=\"right\">{{- row.MarketValue|uformat_number-}}</td>\n                        <td class=\"right\">{{- row.MTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.QTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.YTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.ITD|uformat_percent_100:1-}}</td>\n                    </tr>\n                {% endif %}\n            {% endfor %}\n            <tr class=\"level1\">\n                <td class=\"left\">Benchmarks</td>\n                <td></td>\n                <td></td>\n                <td></td>                <td></td>                <td></td>\n            </tr>\n            {% for row in Rows %}\n                {% if row.Aggregation  == 'Benchmark' %}\n                    <tr class=\"level2\">\n                        <td class=\"left\">{{ row.Name }}</td>\n                        <td class=\"right\"></td>\n                        <td class=\"right\">{{- row.MTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.QTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.YTD|uformat_percent_100:1-}}</td>\n                        <td class=\"right\">{{- row.ITD|uformat_percent_100:1-}}</td>\n                    </tr>\n                {% endif %}\n            {% endfor %}\n        </tbody>\n    </table>\n</div>",
