                "name": "Default",
                "template": "<style>\n .data-table th {line-height:1.1;vertical-align:bottom;padding:4px !important;border-left:1px solid #efefef !important; padding-left:1px !important}\n.left {white-space:nowrap !important}</style>\n\n{%-assign tableName= 'myTable'-%} \n<!-- liquid-top view process all cols (Label, Value) adding % of Total -->\n\n<div class=\"data-table-wrapper\">\n  <table id=\"{{-tableName-}}\" class=\"data-table {{activeclass}}\">\n    <!-- building from column names--->\n    <thead>\n      <tr>\n                  {% for schema in Schema %}\n                      {% if schema.Visibility == 'v'%}\n                              {% case schema.DataType%}\n                                   {% when 'string'%}\n                                     <th class=\"left {{row[1] }}\">{{schema.Caption}}</th>\n                                   {% when 'SQLdate'%}\n                                     <th class=\"left {{row[1] }}\">{{schema.Caption}}</th>\n                                   {% else %}\n                                     <th class=\"right {{row[1] }}\">{{schema.Caption}}</th>     \n                              {% endcase%}\n                     {% endif %}\n                  {% endfor %}\n       </tr>\n    </thead>\n\n    <tbody>\n\n   {% for row in Rows%}\n      <tr>\n      {% for col in row%}\n\n                  {% assign colname = col[0]%}\n                  {% for schema in Schema %}\n                      {% if schema.ColumnName == colname%}\n                          {% assign schema_caption = schema.Caption %}\n                           {% assign schema_datatype = schema.DataType %}\n                           {% assign schema_format = schema.NumberFormat %}\n                              {% case schema_datatype%}\n                                   {% when 'string'%}\n                                      {% assign schema_justify = 'left'%}\n                                   {% when 'SQLdate'%}\n                                      {% assign schema_justify = 'left'%}\n                                   {% else %}\n                                        {% assign schema_justify = 'right'%}      \n                              {% endcase%}\n                          {% break %}\n                      {% endif %}\n                  {% endfor %}\n\n   {% assign justify = schema_justify %}\n \n      <td class=\"{{justify}}\">\n            {% case schema_datatype%} \n                 {% when 'string' %}{{col[1] | truncate : 30}}\n                 {% when 'SQLdate' %}{{col[1]}}\n                 {%else%}\n                     {%assign rowTotal = col[1]%}\n                     {%assign topTotal = topTotal | plus : col[1]%}\n                    {{col[1] | uformat_number}}\n             {% endcase %}\n       </td>\n\n       {%endfor%}\n       </tr>\n   {% endfor %}\n  \n    </tbody>\n\n     \n  </table>\n</div>",
