                "name": "Pivot Card",
                "template": "<!-- HELP -->\n\n<!-- OPTIONS -->\n<!-- columns=c1,c2,c3 provide order range of columns which are actually pivot values -->\n<!-- number=integer,thousands,millions >\n<!-- rowtotals=true/false  are totals at the left on every row -->\n\n<!-- SUPPORTED -->\n<!-- only single level groupings; no second leve groupings rendered -->\n\n<!-- END OF OPTIONS FROM VIEW -->\n\n<style>\n .data-table th {line-height:1.1;\n    vertical-align:bottom;\n    padding:4px !important;\n    border-left:1px solid #efefef !important;\n    padding-left:1px !important}\n.left {white-space:nowrap !important}\n\n.liquid-card {text-align:center;padding:10px; float:left; width:100px; height:90px}\n#card-value {font-size:1.3em;font-weight:bold;border-bottom:1px solid gray}\n#card-label {font-color:gray; font-size:.8em}\n</style>\n\n\n{% assign options = Option | split : \";\"%}\n{% assign rowtotals  = true %}\n{% assign totals = true %}\n{% assign number = '' %}\n<!-- default columns to rows item layout - remember pivot column heads are derived from data -->\n    {% capture colorder %}\n        {% for col in Rows[0] offset :1%}{{ col[0] }}{% if forloop.last %}{% else %},{% endif %}{% endfor %}\n{% endcapture %}\n{% assign colorder = colorder | strip %}\n\n\n    {% for option in options %}\n         {% assign thisOptions = option | split : \"=\" %}\n            {% case thisOptions[0] %}\n                 {% when 'totals' %}\n                    {%if thisOptions[1] == \"true\"%}{% assign totals = true %}{%else%}{%assign totals = false%}{%endif%}\n                 {% when 'rowtotals' %}\n                    {%if thisOptions[1] == \"true\"%}{% assign rowtotals = true %}{%else%}{%assign rowtotals = false%}{%endif%}\n                 {% when 'columns' %}\n                    {% assign  colorder = thisOptions[1]%}            \n                  {% when 'number' %}\n                    {% assign  number = thisOptions[1]%}        \n             {% endcase %}\n     {% endfor %}\n\n{% assign tableName= 'myTable' %} \n{% assign colorder = colorder | split : \",\" %}\n\n<!-- shape dataset to reflect column order -->\n\n {%assign tiles = 1%}\n{% capture dataset_list %}\n     {% for row in Rows %}       \n            {% for colName in colorder%}\n                {% assign tiles = tiles | plus:1 %}\n                {% if colName != ''%}\n                     {%assign found = false%}\n                     {% for c in row%}\n                          {% if c[0] == colName %}\n                              {{c[1]}}~\n                              {%assign found = true%}\n                          {% endif %}\n                       {% endfor %}\n                     {%if found %}{%else%}0~{%endif%}\n                {% endif%}\n           {% endfor %}^\n   {% endfor %}\n{% endcapture %}\n{% assign dataset = dataset_list | split : \"^\"%}\n{% assign width = 100 | divided_by : tiles %}\n<!-- liquid-pivot derives column headers from data -->\n\n<div class=\"data-table-wrapper\">\n\n   {% for row in dataset%}\n       {% if forloop.last %}{% else %}   \n       {%assign cols = row | split : \"~\" %}\n        {% assign colnum = 1 %}\n        {% assign rtotal = 0 %}\n            {% for cell in cols %}\n                {% if forloop.last %} {% else %}\n                  <div class=\"liquid-card\" style=\"width:{{width}}%\" >          \n                            {% case number %}\n                                {% when 'millions' %}\n                                    {% assign value = cell | divided_by : 1000000%}\n                                {% when 'thousands' %}\n                                    {% assign value = cell | divided_by : 1000%}                                 \n                                {% when 'integer' %}\n                                    {% assign value = cell | plus : 0 %}\n                                {% else %}\n                                    {% assign value = cell | u_toint %}\n                            {% endcase %}\n                            {% assign rtotal = rtotal | plus : value%}\n                          \n                          \n                          <div id=\"card-value\">\n                             {% case number %}\n                                {% when 'millions' %}{{value | append :\"M\"}}\n                                {% when 'thousands' %}{{value | append :\"K\"}}\n                                {% else %}{{value}}\n                            {% endcase %}                         \n                          </div>\n\n                          <div id=\"card-label\">\n                               {% assign cindex = colnum|minus:1%}\n                               {%for label in colorder offset : cindex %}\n                                   {%if forloop.index == 1%}\n                                      {{label%}}\n                                   {% else %} {%break%} {% endif %}\n                               {%endfor%}\n                           </div>\n                   </div>\n\n               {% endif %}\n               {% assign colnum = colnum | plus:1%}\n           {% endfor %}     \n\n        {% if rowtotals %}\n                   <div class=\"liquid-card\" style=\"width:{{width}}%\" >\n                          <div id=\"card-value\">{{rtotal}}</div>\n                          <div id=\"card-label\">Total</div>\n                   </div>\n        {% endif %}\n\n\n\n        {% endif  %}\n   {% endfor %}\n  \n\n</div>",
                "matchValue": "liquid-std-pivot-card",
                "server": false
