export function replaceLiquidPolicyValues(str, toMatch, policies) {
  var toMatchLength = toMatch.length,
    match,
    i = 0;

  while ((match = str.indexOf(toMatch, i)) > -1) {
    let start = match;
    let end = str.substring(match, str.length).indexOf('}', 0) + match + 1;
    let replaceString = str.substring(start, end); // {Policy.PolicyNameExample}
    let policyName = replaceString.replace(toMatch, '');
    policyName = policyName.replace('}', ''); // PolicyNameExample
    if (policies[policyName]) {
      //Do we have a policy value for the policy provided in the liquid script?
      str = str.replace(replaceString, policies[policyName].Value); // Replace the reference with the policy value
    } else {
      str = str.replace(replaceString, ''); // Replace policy reference with an empty string
    }
    i = match + toMatchLength;
  }
  return str;
}

export const sweetAlert = {
    delete: () => {
      return new Promise((resolve) => {
        Swal.fire({
          title: "Are you sure?",
          text: `Are you sure you want to delete this record`,
          icon: "warning",
          showCancelButton: true,
          confirmButtonColor: "#ff0000",
          cancelButtonColor: "#131e29",
          confirmButtonText: " Delete !",
        }).then((result) => {
          if (result.isConfirmed) {
            resolve(result);
          }
        });
      });
    },
  
    success: (message = "Your work has been saved") => {
      Swal.fire({
        position: "top-end",
        text: message,
        showConfirmButton: false,
        width: "300px",
        timer: 1500,
      });
    },
  
    deleted: (message = "Record deleted") => {
      Swal.fire("Deleted!", message, "success");
    },
  };

  export const getAllNextSiblings = (elem) => {
    let siblings = [];
    while (elem = elem.nextElementSibling) {
      siblings.push(elem);
    }
    return siblings;
  }